    list: [{ id: 0, lat: 12345, lng: 12345 }]
}

export async function  showCoordenates(state = initialState, action) {
    console.log(action.type)
    switch (action.type) {
        case SHOW_COORDENATES:
            return Object.assign({}, state, { list: action.payload })
        case ADD_COORDENATES:
            setCoordenates(action.coordenate)
            return state
        case DELETE_COORDENATES:
            console.log('hdkasjhdkjah')
            await deleteCoordenates();

            return {...state,list:[]}
        default:
            return state
    }
}
